import React, { useEffect, useState } from 'react'

const Login = () => {

  const [test, setTest] = useState(0)

    const sum = (a : number, b : number) : number => {
        return a + b
    }

    useEffect(() => {
      setTest(test+1)
    },[])

  return (
    <div>
        <p>login : {sum(5, 10)}</p>
        <p>{test}</p>
    </div>
  )
}

export default Login
